import React, { Component } from 'react';
import Box from './Box'

export default class Col extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        let col = [];
        for(let i=0; i<8; i++){col[i]=i;}
        return(
            col.map((box)=>{
                return(<Box key={String(box.i)+String(box.j)} color={box.color}/>);
            })
        );
    }
}
